import React, { useState, useEffect } from "react";

const Test = () => {
	const [count, setCount] = useState(0);

	const tick = () => {
		setCount(count + 1);
	};

	useEffect(() => {
		setInterval(tick, 1000);
	}, []);

	return <button>{count}</button>;
};

export default Test;
